contract PoC5 {
    constructor () payable {}

    function transferAsset(address payable _to) public payable {
        bool sent = _to.send(msg.value); // return true or false
        require(sent,"Failed to send either");
    }

    function callRevert() public {
        address someone = 0x0000000000000000000000000000000000000000;
        require(address(this) == someone);
    }
}
